CREATE TABLE `player_details` (
  `player_id` int(10) UNSIGNED NOT NULL,
  `player_name` varchar(255) NOT NULL,
  `player_country` varchar(255) NOT NULL,
  `player_type` varchar(255) NOT NULL,
  `player_age` int(11) NOT NULL,
  `player_gender` varchar(1) NOT NULL,
  `player_aggression` int(11) NOT NULL,
  `player_price` bigint(20) NOT NULL,
  `skill_level_batting` double NOT NULL,
  `skill_level_bowling` double NOT NULL,
  `skill_level_fielding` double NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00'
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

